import './home-directory.style.scss'

const HomeDirectory = ({categories}) => {

    return(
        <div className="home-directory-container">
        {categories.map((category) =>(
          //key写在组件上
           <DirectoryItem key={category.id} category={category}/>
          ))}
      </div>
    )
}

